import NavBar from '../NavBar';
import Footer from '../Footer';
import { Container, Row, Col } from 'react-bootstrap';


export default function Molly(){
    return (
        <div>
            <NavBar/>
            <img src="" alt="molly" />
            <div className="petLeftContainer"></div>
            <div>My Profile</div>
            <div>Status</div>
            <Footer/>
        </div>
    )
}
